import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to appear (featured products grid)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open the product detail modal
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });

    // Take screenshot of product detail modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Click the "Add to Wish List" button
    await page.click('.add-to-wishlist');

    // Wait for the notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // Close the product modal (click the close button)
    const closeBtn = await page.$('.modal .close');
    if (closeBtn) {
      await closeBtn.click();
    }

    // Go to the wishlist page (find "Your Wish List" link and click)
    // Try to find by text, fallback to nth occurrence if needed
    let wishlistLink = await page.$('a:has-text("Your Wish List")');
    if (!wishlistLink) {
      // Fallback: select the first matching link by text content
      const links = await page.$$('a');
      for (const link of links) {
        const text = await link.textContent();
        if (text && text.trim() === 'Your Wish List') {
          wishlistLink = link;
          break;
        }
      }
    }
    if (!wishlistLink) throw new Error('Could not find "Your Wish List" link');
    await wishlistLink.click();

    // Wait for wishlist page to load
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.waitForSelector('.wishlist-items', { timeout: 5000 });

    // Take screenshot of wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract the first wishlist item title for verification
    let wishlistTitle = null;
    const wishlistTitleEl = await page.$('.wishlist-title');
    if (wishlistTitleEl) {
      wishlistTitle = (await wishlistTitleEl.textContent())?.trim();
    }

    // Extract all wishlist item titles for completeness
    const wishlistTitles = [];
    const wishlistTitleEls = await page.$$('.wishlist-title');
    for (const el of wishlistTitleEls) {
      const txt = await el.textContent();
      if (txt) wishlistTitles.push(txt.trim());
    }

    return {
      success: true,
      action: "Added first product to wishlist and verified it appears in the wishlist page",
      extractedData: {
        firstWishlistTitle: wishlistTitle,
        allWishlistTitles: wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
